import React from "react";

const Rank = ({ name, entries }) => {
    return (
        <div>
           <div className="white f3">
                {`Holla ${name}! Your current entry count is...`}
           </div>
           <div className="white f1">
                {entries}
           </div>
        </div>
    );
}

export default Rank;
